import React from 'react';
import projectList from '../../../utils/main/section-projects/projectList';

function Carousel() {
  const projectCard = projectList.map((item) => (
    item.index !== '6'
      ? (
        <li key={item.index} className="project-item">
          <div className="project-card">
            <img src={item.imageUrl} alt={item.imageAlt} className="project-cover" />
            <h3 className="project-title">{item.title}</h3>
            <div className="project-buttons">
              <a href={item.projectUrl} target="_blank" rel="noreferrer"><button type="button" className="project-button">Voir le projet</button></a>
              <a href={item.codeUrl} target="_blank" rel="noreferrer"><button type="button" className="code-button">Voir le code</button></a>
            </div>
          </div>
        </li>
      )
      : (
        <li key={item.index} className="project-item">
          <div className="project-card">
            <img src={item.imageUrl} alt={item.imageAlt} className="project-cover" />
            <h3 className="project-title">{item.title}</h3>
            <div className="project-buttons">
              <a href={item.projectUrl} target="_blank" rel="noreferrer"><button type="button" className="project-button">Voir le projet</button></a>
              <a href={item.codeUrl} target="_blank" rel="noreferrer"><button type="button" className="code-button">Voir le code</button></a>
            </div>
          </div>
        </li>
      )
  ));

  return (
    <div className="carousel-container">
      <ul className="project-list">
        {projectCard}
      </ul>
    </div>
  );
}

export default Carousel;
